import React from 'react';

const MapComponent = () => {
  return (
    <div style={{ width: '100%', height: '100%' }}>
      <iframe
        title="Google Map"
        width="100%"
        height="100%"
        frameBorder="0"
        style={{ border: 0 }}
        src="https://www.google.com/maps/place/-23.545769416503457%20-46.43591837632585"
        allowFullScreen
      ></iframe>
    </div>
  );
};

export default MapComponent;
